import React from "react";
import "./ProductSection.css";

const ProductSection = () => {
  const products = [
    { id: 25, name: "Ring", image: "/images/product/25.jpg", price: "₹54015" },
      { id: 26, name: "Diamonds", image: "/images/product/26.jpg", price: "₹94015" },
      { id: 27, name: "Diamonds", image: "/images/product/27.jpg", price: "₹94015" },
      { id: 28, name: "Diamonds", image: "/images/product/28.jpg", price: "₹94015" },
      { id: 29, name: "Diamonds", image: "/images/product/29.jpg", price: "₹94015" },
      { id: 30, name: "Diamonds", image: "/images/product/30.jpg", price: "₹94015" },
      { id: 31, name: "Diamonds", image: "/images/product/31.jpg", price: "₹94015" },
      { id: 32, name: "Diamonds", image: "/images/product/32.jpg", price: "₹94015" },
      { id: 33, name: "Diamonds", image: "/images/product/33.jpg", price: "₹94015" },
      { id: 34, name: "Diamonds", image: "/images/product/34.jpg", price: "₹94015" },
      { id: 35, name: "Diamonds", image: "/images/product/35.jpg", price: "₹94015" },
      { id: 36, name: "Diamonds", image: "/images/product/36.jpg", price: "₹94015" },
  ];

  return (
    <div className="product-section">
      <h2>Our Collection</h2>
      <div className="product-grid">
        {products.map((product) => (
          <div key={product.id} className="product-card">
            <div className="image-container">
              <img src={product.image} alt={product.name} />
              <div className="hover-info">
                <h3>{product.name}</h3>
                <p>{product.description}</p>
                <p className="price">{product.price}</p>
                <button className="quick-view-btn">Quick View</button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ProductSection;
